  false,\n\t\"url\": null,\n\t\"notes\": \"These data were generated to provide insight
  into marine traffic patterns on a macro scale so they could be analyzed across the
  coastal waters of the Continental United States, this data set is for the UTM Zone
  10S. For this dataset a transit is counted for every unique vessel intersecting
  a 1 kilometer square grid cell each day. This data represents the total number of
  vessel transits from October 2009 - October 2010. Some grid cells were unable to
  be processed, but this does not interfere with the integrity of this dataset. Please
  note multiple connection errors occurred during the time frame of this study. In
  most cases data gaps were filled by making subsequent request to the coastguard
  or other groups receiving the same data feed. However, due to resource constraints
  uninterrupted coverage was not obtained. Overall data outages were minimal on the
  order less than a day per month and because random and affect all areas uniformly
  do not has a significant effect on the integrity of the data. Also as stated on
  the USCG NAIS website AIS data is not representative of all vessel traffic and USCG
  NAIS receivers do not fully cover the entire extent of this study area. Please take
  time to understand both of these limitations.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
